import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import Acciones from './componentes/Acciones';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <Acciones />
  </React.StrictMode>
);


